window.bookSummaryJSON = "<p>Toxic mist drives all life to the brink of destruction, and the conqueror queen, Ines, has her talons in the kings of the realm.</p> <p>Bleak, having discovered her true heritage, must now scour the lands for the one thing that might save them all.</p> <p>But the search is a treacherous one - and it will push her to the very limits of endurance.</p> <p>Amidst secrets, lies, and the intricacies of battle, Bleak and her companions learn just how far they’ll go for the ones they love. But will it be enough?</p> <p>As deadly forces grapple for power across the continents, families, friends, and allies unite to take one final stand.</p> <p>Explosive revelations, heart-wrenching betrayals, and breathtaking magic soar in the epic conclusion to Helen Scheuerer’s best-selling trilogy, the Oremere Chronicles.</p>"; 
